X-Men Origins Wolverine (Lobezno) es la pelicula basada en el personaje de ficcian de Marvel del Comics de Wolverine, que se va a estrenar el 1 de mayo de 2009 en los cines de USA. La pelicula esta dirigida por Gavin Hood y actores como Hugh Jackman como  Wolverine . Se trata de una precuela a los peliculas anteriores de la trilogia de X-Men, centrandose en el mutanteWolverine y su tiempo con el equipo X. La pelicula esta siendo filmada principalmente en Australia y Nueva Zelanda.Siguiendo los eventos de X-Men, X-Men Origins: Wolverine cuenta la historia del pasado violento y romantico de Wolverine, asi como su compleja relacian con Victor Creed (Dientes de Sable-Sabretooth), y el ominipotente programa de Arma-X. Por el camino, Wolverine se encontrara con muchos mutantes, unos familiares y otros nuevos, incluidas apariciones sorpresa de varia leyendas del universo X-Men.

